import React from 'react';
import { Typography } from "@material-ui/core";


const Logo = () => {
    return (
        <div
            style={{
                display: 'inline-flex',
                AlignItems: 'center'
            }}
        >
            <Typography variant="h4">Moonstripe</Typography>
        </div>
    )
}

export default Logo;
